import React, { Component } from 'react';
import Title from './Title.js';
import LoginPane from './LoginPane.js';
import './App.css';
import { Button } from 'react-bootstrap';

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      userOneLoggedIn: false,
      userTwoLoggedIn: true,
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Title></Title>
          <div className="Pane-row">
            <LoginPane user="melissamasia" loggedIn={this.state.userOneLoggedIn}></LoginPane>
            <LoginPane user="tmarij4" loggedIn={this.state.userTwoLoggedIn}></LoginPane>
          </div>
          < Button className="Compare-libs" bsSize="large">
              Compare Spotify Libraries
          </Button>
        </header>
      </div>
    );
  }
}

export default App;
